import React, { Component } from 'react'
import '../css/home_navbar.css'
import { ReactComponent as ContactUsBtn } from '../images/ContactUsBtn.svg'
import Vector40 from '../images/ContactUsBtn/Vector40.png'

export default class Home_NavBar extends Component {
    constructor(props) {
        super(props)

    }

    render() {
        return (
            <div className="HomeNavBar"> 
                <div className="ExidioLogo" />
                <NavCell title="dVPN" />
                <NavCell title="Cosmos" />
                <NavCell title="Sentinel" />
                <NavCell title="Team" />
                <div className="ContactUs">
                    <div>Contact Us</div>
                    <div className="ContactUsBtn"/>
                </div>
            </div>
        )
    }
}

export class NavCell extends Component {
    constructor(props) {
        super(props)

    }

    render() {
        return (
        <div className="NavCell">{this.props.title}</div> 
        )
    }
}
